import React, { Component } from "react";
import { Link } from "react-router-dom";
import { Badge, Button, Col, Form, Nav, Navbar, NavDropdown, Row } from "react-bootstrap";


export default class NavBar extends Component {
  render() {
    return (
        <Navbar collapseOnSelect expand="sm" bg="dark" variant="dark">
        <Navbar.Brand href='/'>
            <i class='fas fa-brain'>Shopify</i></Navbar.Brand>
        <Navbar.Toggle aria-controls="responsive-navbar-nav" />            
        <Navbar.Collapse id="responsive-navbar-nav">
        <Nav class="mr-auto">

        <Nav.Link href='/products' class='nav-link'>
            <i class="fas fa-store">Shop Online</i> 
        </Nav.Link>    
        <NavDropdown.Divider />
        <Link to='/cart' class='nav-link'>

<Button style={{border:'#9e9e9e solid 0.1rem'}}  variant='success' eventKey='4.3'>
        <i class='fas fa-cart-plus'></i>
        <Badge variant="secondary">2</Badge>
    </Button>
    </Link>
        </Nav>
        </Navbar.Collapse>
 
      </Navbar>
    );
  }
}
